function testinit() { 

  var result=-1;
  result = Init();  
  var expected = 1;
  is(result, expected, "testinit return expected");

}

function testASN1instantiation()
{
  var lengthofdata = 100;
  var data = new Array(lengthofdata);
  var obj = new CASN1();
  var result = obj.CASN1p3(lengthofdata,data,lengthofdata+1);
  var expected = 1;
  is(result, expected, "CASN1p3() return expected");
}

function testAppendASN1()
{
  var data = "johnny";
  var lengthofdata = data.length;
  var obj = new CASN1();
  var result = obj.CASN1p1(lengthofdata+4+1); // CASN1 asn1(name.length()+sizeof(int)+sizeof(__byte));

  var expected = 1;
  is(result, expected, "CASN1p1() return expected");
  result = false;
  expected = true;
  var ElementType = 10 & 0x000000FF; // tag 
  result = obj.AppendASN1(lengthofdata, ElementType, data);
  is(result, expected, "AppendASN1() return expected");
}

function testFetchNextASN1()
{
  var data = "johnny";
  var data2 = "serup";
  var lengthofdata = data.length;
  var lengthofdata2 = data2.length;
  var obj = new CASN1();
  var result = obj.CASN1p1(lengthofdata+4+1+lengthofdata2+4+1); // CASN1 asn1(name.length()+sizeof(int)+sizeof(__byte));

  result = false;
  var expected = true;
  var ElementType = 10 & 0x000000FF; // tag 
  result = obj.AppendASN1(lengthofdata, ElementType, data);
  result = obj.AppendASN1(lengthofdata2, ElementType, data2);
  
  result = false;
  expected = true;
  var param = {
	  Length:0,
	  Tag:0,
	  pdata:0
  };
  result = obj.FetchNextASN1(param);
  if(param.Length == 6 && param.Tag == 10 && param.pdata == "johnny")
	  result = true;
  else
	  result = false;
  is(result, expected, "FetchNextASN1() return expected");

}

function testFetchTotalASN1()
{
  var data = "johnny";
  var data2 = "serup";
  var lengthofdata = data.length;
  var lengthofdata2 = data2.length;
  var obj = new CASN1();
  var maxwritesize = (lengthofdata+4+1+lengthofdata2+4+1);
  var result = obj.CASN1p1(maxwritesize); // CASN1 asn1(name.length()+sizeof(int)+sizeof(__byte));

  var result = obj.WhatIsWriteSize();
  var expected = maxwritesize;
  is(result, expected, "WhatIsWriteSize() return expected");
  result = false;
  expected = true;
  var ElementType = 10 & 0x000000FF; // tag 
  result = obj.AppendASN1(lengthofdata, ElementType, data);
  result = obj.AppendASN1(lengthofdata2, ElementType, data2);
  result = obj.WhatIsReadSize(); 
  expected = 21;
  is(result, expected, "WhatIsReadSize() return expected");
  result = false;
  expected = true;
  var param = {
	  Length:0,
	  pdata:0
  };
  result = obj.FetchTotalASN1(param);
  if(param.Length == 21 && param.pdata[5] == "j" && param.pdata[16] =="s")
	  result = true;
  else
	  result = false;
  is(result, expected, "FetchTotalASN1() return expected");

}


