function testDED_GET_ENCODED_DATA()
{
    var result = -1;
    //var trans_id = 1 & 0x000000FF; // unsigned short
    var trans_id = 1; // unsigned short
    var action = true;

    var encoder_ptr = DED_START_ENCODER();
    if (encoder_ptr <= 0)
        result = -1;
    var expected = 1;
    DED_PUT_STRUCT_START(encoder_ptr, "event");
    DED_PUT_METHOD(encoder_ptr, "name", "MusicPlayer");
    DED_PUT_USHORT(encoder_ptr, "trans_id", trans_id);
    DED_PUT_BOOL(encoder_ptr, "action", action);
    DED_PUT_STRUCT_END(encoder_ptr, "event");
    var DEDobject = {
        encoder_ptr: encoder_ptr,
        uncompresseddata: -1,
        iLengthOfTotalData: -1,
        pCompressedData: -1,
        sizeofCompressedData: -1
    };
    result = DED_GET_ENCODED_DATA(DEDobject);
    if (result > 0)
        result = 1;
    is(result, expected, "DED_GET_ENCODED_DATA return expected");

    // make bytes of same type
    var srcUncompressedArray = new Uint8Array(DEDobject.iLengthOfTotalData);
    for (i = 0; i < DEDobject.iLengthOfTotalData; i++) {
        var str = DEDobject.uncompresseddata[i];
        if (typeof str === 'string')
            srcUncompressedArray[i] = str.charCodeAt();
        else
            srcUncompressedArray[i] = DEDobject.uncompresseddata[i];
    }

    // decompress from decoder
    var decmprsd = decompress_lzss(DEDobject.pCompressedData, DEDobject.sizeofCompressedData);
    var src = "";
    var src2 = "";
    for (i = 0; i < DEDobject.iLengthOfTotalData; i++) src += srcUncompressedArray[i]; // convert to string -- hmmm
    for (i = 0; i < DEDobject.iLengthOfTotalData; i++) src2 += decmprsd[i]; // convert to string -- hmmm

    is(src2, src, "decompress_lzss decompress success");
}

